( function () {
	"use strict";

	var GUID_SEED = 0;

	function GUID () {
		return s4() + s4() + '-' + s4() + '-' + s4() + '-' + s4() + '-' + s4() + s4() + s4();
	}
	
	function s4 () {
	    return Math.floor ( ( ++GUID_SEED + new Date ().getTime () ) * 0x10000 ).toString ( 16 ).substring ( 1 );
	}

	function Scale9HTMLLayer () {

		var _this = this;

		function _construct () {

		}

		function _getLayer ( id, htmlClass ) {
			var $scale9Layer = $ ( "<li class='" + htmlClass + "'>" );
			$scale9Layer.addClass ( htmlClass );
			return $scale9Layer;
		}

		_this.inject = function ( $container, config, id ) {

			var property;
			var $scale9Layer;
			var cssStyle = ""; // ss.oddtube.TEXT [ "scale9-template" ];

			var borderRadius = 0;
			var borderInset = 0;

			var guid = ( ss.isEmpty ( id ) ) ? "s9_" + GUID () : id;
			var $scale9 = $ ( "<ul id='" + guid + "'>" );

			if ( !ss.isEmpty ( $container.attr ( "id" ) ) ) {
				// each element get's a UID

				for ( property in config ) {

					switch ( property ) {
						case "top-left" :
						case "top" :
						case "top-right" :
						case "right" :
						case "bottom-right" :
						case "bottom" :
						case "bottom-left" :
						case "left" :
							$scale9Layer = _getLayer ( guid, property );
							$scale9.append ( $scale9Layer );
							cssStyle = cssStyle.replace ( new RegExp ( "{"+property+".width}", "g" ), config [ property ].width ).replace ( new RegExp ( "{"+property+".height}", "g" ), config [ property ].height ).replace ( "{"+property+".url}", config [ property ].url );
							break;
						case "background" :
							$scale9Layer = _getLayer ( guid, property );
							$scale9.prepend ( $scale9Layer );
							cssStyle = cssStyle.replace ( new RegExp ( "{"+property+".width}", "g" ), config [ property ].width ).replace ( new RegExp ( "{"+property+".height}", "g" ), config [ property ].height ).replace ( "{"+property+".url}", config [ property ].url );
							break;
						case "generic" :
							borderRadius = ss.setDefault ( config.generic [ "border-radius" ], borderRadius );
							borderInset = ss.setDefault ( config.generic [ "border-inset" ], borderInset );
							break;
					}
				}
			}

			cssStyle = cssStyle.replace ( /\{container\}/g, guid )
			.replace ( /\{border-inset\}/g, -borderInset )
			.replace ( /\{border-radius\}/g, borderRadius )
			.replace ( /\{calc.top\}/, config [ "top-left" ].width + config [ "top-right" ].width + 2 * borderInset ) // {top-left.width}px + {top-right.width}px + 2*{border-inset}
			.replace ( /\{calc.right\}/, config [ "top-right" ].height + config [ "bottom-right" ].height + 2 * borderInset )
			.replace ( /\{calc.left\}/, config [ "top-left" ].height + config [ "bottom-left" ].height + 2 * borderInset )
			.replace ( /\{calc.bottom\}/, config [ "bottom-left" ].width + config [ "bottom-right" ].width + 2 * borderInset )

			var $style = $ ( "<style></style>" ).html ( cssStyle );
			// $scale9.append ( $style );
			$container.prepend ( $scale9 );

		};

		return _construct ();
	}

	require.ready ( function () {
		ss.oddtube.Scale9HTMLLayer = new Scale9HTMLLayer ();
	} );
	

} () );
