( function () {
	"use strict";

	function UGCLinkManager () {

		var _this = this;
		var _commandQueue;

		function _construct () {
			return _this;
		}

		/**
		 * Show the links one the left of the screen, with Olympia holding signs for the active UGC content.
		 * @param  {string} videoId - The currently playing video. This is included because we don't want to show the UGC link for the current video, only other ones.
		 */
		_this.showUGCLinks = function (videoId) {

			{ // 0. Setup vars.
				var topSelector = "#ugcVoteTop";
				var bottomSelector = "#ugcVoteBottom";
				var topSelectorMobile = "#ugc_mobile_top";
				var bottomSelectorMobile = "#ugc_mobile_bottom";
				var linkList = ss.oddtube.CONFIG.ugc.ugcLinks;
				var linksSoFar = 0;
			}

			{ // 1. Clear the links.
				$(topSelector + " img").hide();
				$(bottomSelector + " img").hide();
				$(topSelector + " img").attr("src", "");
				$(topSelector + "img.ugcImageHover").attr("src", "");
				$(topSelector + " a").attr("href", "");
				$(bottomSelector +" img").attr("src", "");
				$(bottomSelector + "img.ugcImageHover").attr("src", "");
				$(bottomSelector + " a").attr("href", "");
				$(topSelector + " img").unbind("hover");
				$(bottomSelector + " img").unbind("hover");
				$(topSelectorMobile + " img").unbind("hover");
				$(bottomSelectorMobile + " img").unbind("hover");

			}

			{ // 2. Re-create the links based on the current videos.
				for (var i = 0; i < linkList.length; i++) {
					if(linkList[i].associatedVideo !== videoId) {
						linksSoFar++;
						var linkImg = "";
						var linkImgHover = "";
						var selector = "";
						var mobileSelector ="";
						if(linksSoFar == 1) {
							linkImg = linkList[i].topImg;
							linkImgHover = linkList[i].topImgHover;
							selector = topSelector;
							mobileSelector = topSelectorMobile;
						} else {
							linkImg = linkList[i].bottomImg;
							linkImgHover = linkList[i].bottomImgHover;
							selector = bottomSelector;
							mobileSelector = bottomSelectorMobile;
						}
						$(selector + " img").show();
						$(selector + " img").attr("src", linkImg);
						$(selector + " img").attr("data-hover", linkImgHover);
						$(selector + " img").attr("data-normal", linkImg);
						$(selector + " img").hover(function() {
							$(this).attr("src", $(this).attr("data-hover"));
						}, function() {
							$(this).attr("src", $(this).attr("data-normal"));
						});

						$(selector + " img").attr("alt", linkList[i].altText);
						$(selector + " a").attr("href", linkList[i].url);
						$(mobileSelector + " a").attr("href", linkList[i].url);
						$(mobileSelector + " .ugc_content_text").html(linkList[i].mobileText);
						$(mobileSelector + " img").attr("src", linkList[i].mobileButton);
						$(mobileSelector + " img").attr("data-hover", linkList[i].mobileButtonHover);
						$(mobileSelector + " img").attr("data-normal", linkList[i].mobileButton);
						$(mobileSelector + " img").attr("alt", linkList[i].altTextMobile);
						$(mobileSelector + " img").hover(function() {
							$(this).attr("src", $(this).attr("data-hover"));
						}, function() {
							$(this).attr("src", $(this).attr("data-normal"));
						});
					}
				}
			}

			if(linksSoFar < 2) {
				$(bottomSelectorMobile).hide();
			} else  {
				$(bottomSelectorMobile).show();
			}

			if(linksSoFar < 1) {
				$("#ugc_bar_mobile").hide();
			}

		}


		return _construct ();
	}

	ss.oddtube.UGCLinkManager = UGCLinkManager;
} () );
