( function () {
	"use strict";

	createjs.EventDispatcher.initialize ( LocalConnection.prototype );

	function LocalConnection ( domain, receiverWindow ) {

		createjs.EventDispatcher.call ( this );
		var _this = this;

		var _domain;

		var _receiverWindow;

		var _ready;
		var _delay;

		//var _connectInterval;

		function _construct ( domain, receiverWindow ){

			_domain = domain;
			_receiverWindow = receiverWindow;
			_ready = false;

			window.addEventListener ( "message", _onLocalMessage_listener );
		}

		var _queryAPIMessage = function ( data ) {

			if ( data.api == LocalConnection.API_MESSAGE ) {
				return true;
			} else {
				return false;
			}
		};

		var _onLocalMessage_listener = function ( e ) {

			if ( e.origin == _domain ) {

				if ( e.data == LocalConnection.QUERY_CONNECTION ) {

					_ready = true;

					_receiverWindow = e.source || _receiverWindow;

					_receiverWindow.postMessage ( LocalConnection.CONNECTION_COMPLETE, _domain );

					_this.dispatchEvent ( new createjs.Event ( LocalConnection.READY ) ) ;
				} else if ( e.data == LocalConnection.CONNECTION_COMPLETE ) {

					_ready = true;

					_this.dispatchEvent ( new createjs.Event ( LocalConnection.READY ) ) ;
				} else {

					var data;
					try {
						data = JSON.parse ( e.data );
					} catch ( evt ) {
						console.log ( evt );
						data = evt.data;
					}

					var messageEvent;
					if ( _queryAPIMessage ( data ) ) {
						messageEvent = new createjs.Event ( ss.oddtube.LocalConnection.API_MESSAGE );
						messageEvent.invoke = data.invoke;

					} else {
						messageEvent = new createjs.Event ( ss.oddtube.LocalConnection.MESSAGE );
					}

					messageEvent.data = data;
					_this.dispatchEvent ( messageEvent );
				}
			}
		};

		var _onQueryConnection_timeout = function () {


			//if ( !_ready || ss.isEmpty ( _receiverWindow ) ) {

				_receiverWindow.postMessage ( LocalConnection.QUERY_CONNECTION, _domain );

				setTimeout ( _onQueryConnection_timeout, _delay );
			//}
		};

		_this.ready = function () {
			return _ready;
		};

		_this.send = function ( data ) {
			_receiverWindow.postMessage ( data, _domain );
		};

		_this.API = function ( invoke, data ) {

			_receiverWindow.postMessage ( JSON.stringify ( { "api" : LocalConnection.API_MESSAGE, "invoke" : invoke, "data" : data } ), _domain );
		};

		_this.connect = function ( delay ) {

			_delay = ss.isUndefined ( delay ) ? 1000 : delay;

			if ( !ss.isEmpty ( _receiverWindow ) ) {

				setTimeout ( _onQueryConnection_timeout, _delay );
				_receiverWindow.postMessage ( LocalConnection.QUERY_CONNECTION, _domain );
			}
		};

		_this.release = function () {

		};

		return _construct ( domain, receiverWindow );
	}

	LocalConnection.QUERY_CONNECTION = "LocalConnection.QUERY_CONNECTION";
	LocalConnection.CONNECTION_COMPLETE = "LocalConnection.CONNECTION_COMPLETE";
	LocalConnection.READY = "LocalConnection.READY";
	LocalConnection.MESSAGE = "LocalConnection.MESSAGE";
	LocalConnection.API_MESSAGE = "LocalConnection.API_MESSAGE";

	ss.oddtube.LocalConnection = LocalConnection;

} () );
